import React from 'react';

const Table = () => {
    return (
        <div className="tablaDatos">
           <table>
			<thead>
                <tr>
                    <th>ID</th>
                    <th>NOMBRE</th>
                    <th>APELLIDO</th>
                    <th>EDAD</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <th>122</th>
                    <th>augusto</th>
                    <th>perez</th>
                    <th></th>
                </tr>
            </tbody>
		</table> 
        </div>
    );
};

export default Table;
